import React from 'react';
import Navbar from './components/Navbar';
import Hero from './components/Hero';
import Clothes from './components/Clothes';

function App() {
  return (
    <div>
      <Navbar />
      <Hero />
      <Clothes />
    </div>
  );
}

export default App;
